export function vimeoVideoSearch() {
  return (dispatch) => {
    dispatch({type: 'START_VIMEO_SEARCH_REQUEST'})
    fetch(`/videos/getVimeoVideoMetadata/?q=${this.state.searchTerm}`)
      .then(resp => resp.json())
      .then(json => dispatch({ type: 'ADD_VIMEO_VIDEOS', videos }))
  }
}
